response.activities:
Я психолог, лайф-коуч, психотерапевт.
Консультирую по вопросам: 
проблем зачатия и сохранение беременности; 
выхода из психологического кризиса в т.ч. послеродовые депресии, развод, утрата детей и близких; 
проблемы сексуальности (непринятие своего тела, страх близости, отсутствие оргазма, сексуальные травмы); 
личностный рост, смысл жизни, путь к мечте;
семейная и детская психотерапия.
